    public static String toBinary(String num) 
    {
    	int num1 = Integer.parseInt(num);
    	String result ="";
    	
    	while(num1>1) 
    	{
    		result = num1%2 + result ;    		
    		num1= num1/2;
    	}    	        	
    	
    	return "1"+result;
    }
    
