    public static int findPermutationDifference(String s, String t) {
        
    	int result= 0;
        
        for(int i=0; i<s.length(); i++) 
        {
        	char ch = s.charAt(i);
        	int idxOfT = t.indexOf(ch);
        	
        	result += Math.abs(i-idxOfT);
        }
        
    	return result;
    }
	 
    public static int balancedStringSplit(String s) 
    {
        int cntR =0;
        int cntL =0;
        int cntBalStr =0;

        for(int i=0; i<s.length(); i++)
        {
            char ch = s.charAt(i);
            if(ch=='L') cntL++;
            else        cntR++;

            if(cntL == cntR) 
            {
                cntBalStr++;
                cntL=0;
                cntR=0;
            }
        }

        return cntBalStr;
        
    }
    
    public static String decodeMessage(String key, String message) {

        Map<Character,Character> m = new  HashMap<>();
        m.put(' ', ' ');
        
        char valCh = 'a';
        char val=' ';

        for(int i=0; i<key.length(); i++)
        {
        	char keyCh = key.charAt(i);        	        	
        	if(!m.containsKey(keyCh)) 
        	{
        		m.put(keyCh, valCh);
        		valCh++;
        	}        	       
        	        	
        }
        
        String result = "";
        
        for(int i=0; i<message.length(); i++)
        {
        	result = result + m.get(message.charAt(i));        	
        }
		
        return result;


    }
    
