    public static int finalPositionOfSnake(int n, List<String> commands) {
        
    	int i=0, j=0;   //row, column coordinates
        for(String command : commands)
        {
            switch(command) { 
                case "UP"    :   i--;  break;
                case "DOWN"  :   i++;  break;
                case "RIGHT" :   j++;  break;
                case "LEFT"  :   j--;  break;
            }
        }
        
        return i*n+j;
    }
   
