    public String removeTrailingZeros(String num) {
        int size = num.length();

        int lastIdx = size-1;
        for(lastIdx= size-1;lastIdx>=0;lastIdx--)
        {
            if(num.charAt(lastIdx)!='0') break;
        }

        return num.substring(0,lastIdx+1);
    }

    public static boolean halvesAreAlike(String s) 
    {
    	int size = s.length();
    	s= s.toLowerCase();
    	    	        	
    	Set<Character> set = new HashSet<>();    	
    	
    	char []vowels = {'a', 'e', 'i', 'o', 'u'};
    	
    	for(char ch:vowels)   set.add(ch);
    	
    	int counter =0;
    	for(int i=0; i<size/2; i++) 
    	{
    		if( set.contains( s.charAt(i) ) ) counter++;
    		if( set.contains( s.charAt(size-1-i) ) ) counter--;
    		
    	}
    	
    	return counter==0;
    }
   
