    public static int[] shortestToChar(String s, char c) 
    {
        String s1 = s;
        int size = s.length();
        int countOfc = size-s1.replace(c+"","").length();
        
        int [] idxOfc = new int[countOfc];
        idxOfc[0] = -1; 
        
        for(int i=0, j=0; i<size; i++)
        {
            if(s.charAt(i)==c) idxOfc[j++] = i;
        }

        int []dist = new int[size];                        
        
        for(int i=0, j=1; i<size; i++)
        {
            if(i<=idxOfc[0])               
            	dist[i]=idxOfc[0] - i;
            else if(i>=idxOfc[countOfc-1]) 
            	dist[i]=i-idxOfc[countOfc-1];
            else
            {
                for(; j<countOfc; j++)
                {
                    if(i>=idxOfc[j-1] && i<=idxOfc[j])  
                    {
                    	dist[i] = Math.min(i-idxOfc[j-1], idxOfc[j]-i);
                    	break;
                    }
                }
            }
        }

        return dist;
    }
    
