    public static int possibleStringCount(String word) 
    {
    	//Bu problem çok daha bir þekilde çözülebiliyor. (02.09.2025)
    	
        int size = word.length();
        List <Integer> consGroupSizes = new ArrayList<>();
        int chCount=1;
        char prevCh=word.charAt(0);
        
        for(int i=1; i<size; i++)
        {
            char currCh = word.charAt(i);
            if(prevCh == currCh) 
            	chCount++;
            else
            {
                prevCh = currCh;
                consGroupSizes.add(chCount);
                chCount=1;
            }            
        }
        consGroupSizes.add(chCount);
        int result = 0;
        int groupCount = consGroupSizes.size();
        int dublicatedGroupCount = groupCount;
        
        for(int i=0; i<groupCount; i++)
        {
        	int groupSize = consGroupSizes.get(i);
        	if(groupSize>1)
        		result += consGroupSizes.get(i);
        	else 
        		dublicatedGroupCount--;
        }

        result = result - (dublicatedGroupCount-1);
        
        return result;
    }
    
