    public static boolean checkDistances(String s, int[] distance) 
    {
    	char ch;
    	int idx1 = 0;
    	int idx2 = 0;
    	boolean result = true;
    	boolean [] seenBefore = new boolean[26];
    	Arrays.fill(seenBefore, false);
    	
    	for(int i=0; i<s.length(); i++) 
    	{
    		ch = s.charAt(i);
    		
    		if(seenBefore[ch-'a']) 
    			continue;    			
    		
        	idx1 = s.indexOf(ch, 0);
        	idx2 = s.lastIndexOf(ch);
        	
        	if ( distance[ch-'a'] != idx2-idx1-1 ) 
        	{
        		result = false;
        		break;
        	}   
        	seenBefore[ch-'a'] = true;
    	}
    	
    	return result;       
    }
    
