    public static int minimumRecolors(String blocks, int k) {
        
        int minChange = k;
        int whiteCount= 0;
        int size = blocks.length();

        for(int i=0; i<size && size-i>=k; i++)
        {
            whiteCount=0;            
            for(int j=0; j<k && i+j<size; j++)
            {
                whiteCount += (blocks.charAt(i+j)=='W') ? 1 : 0 ;
            }
            minChange = Math.min(minChange, whiteCount);            
        }

        return Math.min(minChange, whiteCount);

    }
    
    public static int minimumRecolors2(String blocks, int k) {
        //bazý test case ler için yanlýþ çalýþýyor.
        int minChange = k;
        int whiteCount= 0;
        int size = blocks.length();
        char []arr = blocks.toCharArray();

        for(int i=0; i<size && minChange>0; i++)
        {
        	if(i>27)		
        		System.out.println("i = " +i);
            if(arr[i]=='W')     
            	whiteCount++;            
            if(i<k-1)             
            	continue;
            
            minChange = Math.min(minChange, whiteCount);
            
            if(arr[i-(k-1)]=='W')   
            	whiteCount--;                       
        }

        return minChange;
    }
 
    
