    public static String reverseOnlyLetters(String s) 
    {
        int size = s.length();
        StringBuilder sb = new StringBuilder();
        
        char [] result = new char[size]; 
        Arrays.fill(result, '\0');                    //'\0' -> null
        
        for(int i=0; i<s.length(); i++) 
        {
        	char ch = s.charAt(i);
        	if(!Character.isLetter( ch ) )  
        		result[i] = ch;
        }        
        
        for(int i=size-1, j=0; i>=0; i--)
        {
        	char ch = s.charAt(i);
                       
        	if(!Character.isLetter(ch) ) 
        		continue;                	               	
        	else if(result[j]=='\0')        	    	 
    			result[j++] = ch;    			    	
    		else 
    		{
    			while(result[j]!='\0') 
    				j++;
    			result[j++]=ch;
    		}    		        	        
        }
        
        return sb.append(result).toString();
    }
    
    public static String reformatNumber(String number) 
    {
    	String result ="";
    	String str = number.replace(" ", "").replace("-","");
        int size = str.length();

        int cnt3sized = size/3;
        if(size%3==1)  cnt3sized--;
        int cnt2sized = (size-cnt3sized*3)/2;

        for(int i=0; i<cnt3sized; i++)
        {
            String block = str.substring(3*i,3*(i+1));
            result+=block+"-";
        }
        int base = 3*cnt3sized;
        for(int i=0; i<cnt2sized; i++)
        {
            String block = str.substring(base + 2*i, base + 2*(i+1));
            result += block + "-";
        }

        String result2 = result.substring(0,result.length()-1);

        return result2;     
    }
    
    public static String capitalizeTitle(String title) {
        int size = title.length();
        StringBuilder sb = new StringBuilder();
        
        char prev = title.charAt(0);
        
        for(int i=0; i<size; i++)
        {
            char curr=title.charAt(i);
            if(curr==' ') { 
                sb.append(" "); 
                prev=curr;
                continue;
            }
            if( prev==' ' || i==0) 
                sb.append(Character.toUpperCase(curr));
            else 
                sb.append(Character.toLowerCase(curr));            

            prev=curr;
        }

        return sb.toString();
    }

