    public static boolean wordPattern(String pattern, String s) {

        Map <Character, String> map = new HashMap<>();
        int size = pattern.length();
        String [] arrWords = s.split(" ");
        char   [] arrCh = pattern.toCharArray();
        boolean result= true;

        if(size!=arrWords.length) return false;

        for(int i=0; i<size; i++ )
        {
            String word= arrWords[i];
            char ch = arrCh[i];
            if(!map.containsKey(ch) && !map.containsValue(word)) 
            	map.put(ch, word);
            else if(map.containsKey(ch)  && !map.get(ch).equals(word))
            {
                result=false;
                break;
            }
            else if(map.containsValue(word) && getKeyFromValue(map, word)!=ch)
            {
            	result=false;
                break;
            }
        }

        return result;
    }
    
