    public int convertTime(String current, String correct) {
        
        //get time diff as minutes
        String []strCurrent = current.split(":");
        String []strCorrect = correct.split(":");
        int  [] hours   = {Integer.parseInt(strCurrent[0]), Integer.parseInt(strCorrect[0])};
        int  [] minutes = {Integer.parseInt(strCurrent[1]), Integer.parseInt(strCorrect[1])};

        int diff = hours[1]*60 + minutes[1] - (hours[0]*60 + minutes[0]);

        int count = 0;
        count+=diff/60;
        diff = diff%60;

        count+=diff/15;
        diff = diff%15;

        count+=diff/5;
        diff = diff%5;

        count+=diff;

        return count;
    }

