    public static String longestNiceSubstring(String s) 
    {
        Stack<String> st = new Stack<>();
        int [][] freq;
        int size=0;
        st.push(s);
        String s1;
        char []arr;
        String longestStr="";        

        while(!st.isEmpty())
        {   
            s1   = st.pop();         
            freq = getFrequencies(s1);
            size = s1.length();        
            arr  = s1.toCharArray();     
            boolean isNice=true;;

            for(int i=0; i<size; i++)
            {                
                char ch = s1.charAt(i);
                int chFreqIdx = Character.toLowerCase(ch)-'a';
                if (freq[chFreqIdx][0]==0 || freq[chFreqIdx][1]==0 ) 
                {
                	isNice =false;
                    String [] parts = s1.split(ch+"");
                    for(int j=parts.length-1; j>=0; j--)
                    {
                        if(parts[j].length()>1) 
                        	st.push(parts[j]);
                    }                   
                    break;
                }               
            }
            longestStr = ( isNice && s1.length() > longestStr.length() ) ? s1 : longestStr;
            
        }

        return longestStr;       
    }
    
