    public static String reverseStr(String s, int k) 
    {
        StringBuilder sb1 = new StringBuilder();
        StringBuilder sb2 = new StringBuilder();
        int len = s.length();

        for(int i=0; i<len; i+=2*k)
        {
            int endIdx1 = Math.min(i+k,len);
            sb2 = new StringBuilder();
            String subStr = s.substring(i,endIdx1);
            String revStr = sb2.append(subStr).reverse().toString();
            sb1.append(revStr);

            int startIdx2 = i+k;
            int endIdx2   = Math.min(i+2*k,len);
            if(startIdx2<=len-1 && endIdx2<=len)
            {                
                subStr = s.substring(startIdx2,endIdx2);
                sb1.append(subStr);
            }        
        }

        return sb1.toString();        
    }
    
    public static String convertToBase7(int num) 
    {
        StringBuilder sb = new StringBuilder();
        int num1 = Math.abs(num);

        while(num1>=7)
        {
            int rem = num1%7;
            num1 = num1/7;
            sb.insert(0,rem);
        }
        sb.insert(0, num1);

        if(num<0)  sb.insert(0,"-");

        return sb.toString();
        
    }
    
    public static String reformat(String s) 
    {
    	int cntDigits  = 0;
        int cntLetters = 0;        
        StringBuilder sbDigits = new StringBuilder();
        StringBuilder sbLetters = new StringBuilder();
        StringBuilder sbResult = new StringBuilder();

        for( char ch:s.toCharArray() )
        {
            if(ch>='0' && ch<='9')  { cntDigits++;  sbDigits.append(ch); }
            else                    { cntLetters++; sbLetters.append(ch); }
        }

        if( Math.abs(cntDigits-cntLetters)>1 ) return "";
        
        int minSize = Math.min(cntDigits, cntLetters);
        char [] chLonger = new char[minSize];
        char [] chShorter = new char[minSize];

        if( cntDigits > cntLetters ) 
        { 
            sbResult.append(sbDigits.charAt(0)); 
            sbDigits.deleteCharAt(0);    
            chLonger  = sbDigits.toString().toCharArray();
            chShorter = sbLetters.toString().toCharArray();
        }
        else if(cntDigits < cntLetters )
        {
            sbResult.append(sbLetters.charAt(0));
            sbLetters.deleteCharAt(0);  
            chLonger  = sbLetters.toString().toCharArray();
            chShorter = sbDigits.toString().toCharArray();           
        }
        else
        {
            chLonger  = sbLetters.toString().toCharArray();
            chShorter = sbDigits.toString().toCharArray(); 
        }

        for(int i=0; i<minSize; i++)
        {
            sbResult.append(chShorter[i]);
            sbResult.append(chLonger[i]);
        }

        return sbResult.toString();
    }
    
