    {
        int len1 = num1.length(); 
        int len2 = num2.length();
        char [] shorter, longer;
        
        if(len1>len2)
        {
            longer = num1.toCharArray();
            shorter= num2.toCharArray();
        }
        else
        {
            longer  = num2.toCharArray();
            shorter = num1.toCharArray();
        }
        int minLen = shorter.length;
        int maxLen = longer.length;

        StringBuilder sbResult = new StringBuilder();
        
        int carry = 0;
        for(int i=0; i<minLen; i++)
        {
            int d1 = shorter[minLen-1-i]-'0';
            int d2 = longer[maxLen-1-i]-'0';
            
            sbResult.insert(0,(d1+d2+carry)%10);
            carry = (d1+d2+carry)/10;
        }

        for(int i=minLen; i<maxLen; i++)
        {
            int d1 = longer[maxLen-1-i]-'0';
            sbResult.insert(0, (d1+carry)%10 );
            carry = (d1+carry)/10;
        }
        if(carry>0) 
            sbResult.insert(0,carry);
        
        return sbResult.toString();
        
    }
    
    public static boolean isLeapYear(int year) 
    {
        return year % 400 == 0 || (year % 100 != 0 && year % 4 == 0);
    }
    
    public static int convertToDays(String date)
    {
        int [] months = {31,28,31,30,31,30,  31,31,30,31,30,31};

        String [] arr = date.split("-");
        int year  = Integer.parseInt(arr[0]);
        int month = Integer.parseInt(arr[1]);
        int day   = Integer.parseInt(arr[2]);

        //int days = (year-1900)*365 + (year-1900)/4 ;
        int sum =0;
        for(int i=1971; i<year; i++)
        {
            sum+=365;
            sum+=isLeapYear(i)?1:0;
        }

        for(int i=0; i<month-1; i++)
            sum += months[i];
        
        sum += day;

        if(isLeapYear(year) && month>2)  sum++;

        return sum;
    }

    public int daysBetweenDates(String date1, String date2) 
    {
    	 int days1 = convertToDays(date1);
         int days2 = convertToDays(date2);

         return Math.abs(days1-days2);     
    }
    
    public static int closestTarget(String[] words, String target, int startIndex) {
        
    	Set <Integer> set = new HashSet<>();
        int len = words.length;

        for(int i=0; i<len; i++)
        {
            if(target.equals(words[i])) 
                set.add(i);
        }

        if(set.isEmpty()) return -1;

        int minDist = len;

        for(int targetIndex:set)
        {
            int start = Math.min(startIndex,targetIndex);
            int end   = Math.max(startIndex,targetIndex);

            //int min1 = Math.min( Math.abs(targetIndex-startIndex), startIndex + len - targetIndex );
            int min1 = Math.min( end-start, start + len - end );
            minDist = Math.min(minDist, min1);
        }

        return minDist;
    }
        
    public static String numberToChar(int num)   //num<16
    {
        return (num<10) ? num+"" : (char)('a' + num-10)+"";
    }  
    
    public String toHex(int num) 
    {
    	//bu problem henüz çözülmedi. Negatif sayýlar için çalýþmýyor. ( 18.09.2025)
        //String [][] map = {{10,'a'},{11,2},{3,1},{4,2},{5,1},{6,6},{7,7},{8,8},{}}
        StringBuilder sb = new StringBuilder();

        while(num>16)
        {
            int rem = num%16;
            String ch = numberToChar(rem);  //(mod<10) ? mod : 'a' + mod-10;
            sb.insert(0,ch);
            num = num/16;
        }        

        String ch = numberToChar(num);  //(mod<10) ? mod : 'a' + mod-10;
        sb.insert(0,ch);

        return sb.toString();
    }
    
    public static boolean areAlmostEqual(String s1, String s2) {
        char [] ch1 = s1.toCharArray();
        char [] ch2 = s2.toCharArray();
        int len1 = s1.length();
        int len2 = s2.length();
        
        Arrays.sort( ch1 );
        Arrays.sort( ch2 );

        if ( len1!=len2 || !String.valueOf ( ch1 ).equals( String.valueOf( ch2)))  return false;
        
        
        ch1 = s1.toCharArray();
        ch2 = s2.toCharArray();
        
        int diffCount = 0;
                
        for(int i=0; i<len1; i++) 
        {
        	if ( ch1[i] != ch2[i] ) diffCount++;
        }
        
        return diffCount<=2;
        	
    }
    
    public static String removeDigit(String number, char digit) 
    {
        StringBuilder sb = new StringBuilder(number);
        int len = number.length();
        char []arr = number.toCharArray();

        //find index
        int idx=len;
        for(int i=0; i<len; i++)
        {
        	if(arr[i]==digit) {
        		idx = i;
	            if( i==len-1  || arr[i]<arr[i+1] ) 
	            {	                
	                break;
	            }            
        	}
        }
        
        String str = sb.deleteCharAt(idx).toString();
        return str;       
    }
    
    
    public static boolean isIsomorphic(String s, String t) {
    	Map<Character,Character> map = new HashMap<>();
        //char[][] map = new char[128][1];

        int len = s.length();
        char [] arr1 = s.toCharArray();
        char [] arr2 = t.toCharArray();
        boolean result= true;

        for(int i=0; i<len; i++)
        {
            char ch1 = arr1[i];
            char ch2 = arr2[i];

            if(!map.containsKey(ch1) && !map.containsKey(ch2)) { 
                map.put(ch1,ch2);
            }
            else
            {
                if( (map.containsKey(ch1) && map.get(ch1)!=ch2 )  || (map.containsKey(ch2) && map.get(ch2)!=ch1 )) 
                {
                    result = false;
                    break;
                }
            }
        }

        return result;

    }
    
